import styled from 'styled-components';

function KatePage () {
    return(
        <Background>
            <TitleWrapper>
                <Title>Hi Kate!</Title>
            </TitleWrapper>
        </Background>
    );
}

const Background = styled.div`
    height: 100vh;
    width: 100%;
    background: pink;
    display: flex;
    justify-content: center;

`;

const Title = styled.h1`
    margin-top: 100px;
    color: white;
    font-size: 112px;
    background: white;
`;

export default KatePage;
